// PublicPage.js

import React from "react";
import { DataTable } from "primereact/datatable";
import { Column } from "primereact/column";
import { Card } from "primereact/card";
import { Button } from "primereact/button";

import "./PublicPage.css"; // Importez un fichier CSS pour les styles personnalisés

const participantsData = [
  { name: "Participant 1", cagnotte: 100 },
  { name: "Participant 2", cagnotte: 150 },
  { name: "Participant 3", cagnotte: 75 },
  // Ajoutez plus de données de participants ici
];

const PublicPage = () => {
  return (
    <div className="public-page dark-mode">
      <h1>Classement</h1>
      <Card className="card dark-mode-card">
        <DataTable value={participantsData} className="datatable">
          <Column field="name" header="Nom du participant" />
          <Column field="cagnotte" header="Cagnotte" />
        </DataTable>
      </Card>
      <Button
        label="Actualiser le classement"
        className="refresh-button dark-mode-button"
      />
    </div>
  );
};

export default PublicPage;
